import { React } from 'react';
import { Route, Routes } from 'react-router-dom';
import Home from './Pages/Home';

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="order" element={<OrderForm />} />
      </Routes>
    </div>
  );
}

function OrderForm() {
  return <div>OrderForm</div>;
}

export default App;
